CREATE FUNCTION public.kategorier() RETURNS TABLE(namn text, kulturmiljotyp text)
    LANGUAGE sql
    AS $$
SELECT ri.namn, string_agg(kulturmiljotyp.namn, ',')
FROM riksintresse AS ri
JOIN riksintresse_har_kulturmiljotyp AS r_h_k ON r_h_k.riksintresse_id = ri.id
JOIN kulturmiljotyp ON r_h_k.kulturmiljotyp_id = kulturmiljotyp.id
JOIN riksintresse_i_kommun ON riksintresse_i_kommun.riksintresse_id = ri.id
JOIN kommun ON riksintresse_i_kommun.kommun_kod = kommun.kod
GROUP  BY ri.namn;
$$;


